DROP DATABASE IF EXISTS central;
CREATE DATABASE central;
USE central;


    CREATE TABLE users (
        id INT AUTO_INCREMENT PRIMARY KEY,
        username VARCHAR(255) UNIQUE NOT NULL,
        password VARCHAR(255) NOT NULL
    );
    

    CREATE TABLE budget_entries (
        id INT AUTO_INCREMENT PRIMARY KEY,
        user_id INT,
        date DATE,
        amount DECIMAL(10,2),
        category VARCHAR(100),
        description TEXT
    );
    

    CREATE TABLE sleeping_entries (
        id INT AUTO_INCREMENT PRIMARY KEY,
        user_id INT,
        date DATE,
        hours FLOAT,
        quality VARCHAR(50),
        notes TEXT
    );
    

    CREATE TABLE sports_sessions (
        id INT AUTO_INCREMENT PRIMARY KEY,
        user_id INT NOT NULL,
        date DATE,
        time TIME,
        duration FLOAT,
        activity VARCHAR(100),
        location VARCHAR(100)
    );
    

    CREATE TABLE studying_entries (
        id INT AUTO_INCREMENT PRIMARY KEY,
        user_id INT,
        date DATE,
        subject VARCHAR(100),
        hours FLOAT,
        productivity INT,
        notes TEXT
    );
    
